import React, { useState } from 'react';
import './styles.css'; // Import the CSS file containing styles

// Information System Component (Parent Node)
const InformationSystem = ({ onAddStakeholder, onAddInfrastructure }) => {
  const [stakeholderName, setStakeholderName] = useState('');
  const [infrastructureName, setInfrastructureName] = useState('');

  const handleAddStakeholder = () => {
    if (stakeholderName.trim() === '') {
      alert('Please enter a valid name for the Stakeholder.');
      return;
    }

    onAddStakeholder(stakeholderName);
    setStakeholderName('');
  };

  const handleAddInfrastructure = () => {
    if (infrastructureName.trim() === '') {
      alert('Please enter a valid name for the Infrastructure.');
      return;
    }

    onAddInfrastructure(infrastructureName);
    setInfrastructureName('');
  };

  return (
    <div className="information-system-box">
      <h2>Information System</h2>
      <div className="children">
        <div className="child-container">
          <input
            type="text"
            placeholder="Enter Stakeholder Name"
            value={stakeholderName}
            onChange={(e) => setStakeholderName(e.target.value)}
          />
          <button className="add-button" onClick={handleAddStakeholder}>+</button>
        </div>
        <div className="child-container">
          <input
            type="text"
            placeholder="Enter Infrastructure Name"
            value={infrastructureName}
            onChange={(e) => setInfrastructureName(e.target.value)}
          />
          <button className="add-button" onClick={handleAddInfrastructure}>+</button>
        </div>
      </div>
    </div>
  );
};

// Stakeholder Component (Child Node)
const Stakeholder = ({ name, onRemove }) => {
  return (
    <div className="stakeholder-box">
      <div className="holon stakeholder">
        <div className="name">{name}</div>
        <button className="remove-button" onClick={onRemove}>x</button>
      </div>
    </div>
  );
};

// Infrastructure Component (Child Node)
const Infrastructure = ({ name, onRemove }) => {
  return (
    <div className="infrastructure-box">
      <div className="holon infrastructure">
        <div className="name">{name}</div>
        <button className="remove-button" onClick={onRemove}>x</button>
      </div>
    </div>
  );
};

// App Component
const App = () => {
  const [stakeholderList, setStakeholderList] = useState([]);
  const [infrastructureList, setInfrastructureList] = useState([]);

  const addStakeholder = (name) => {
    setStakeholderList([...stakeholderList, name]);
  };

  const addInfrastructure = (name) => {
    setInfrastructureList([...infrastructureList, name]);
  };

  const removeStakeholder = (index) => {
    const updatedList = [...stakeholderList];
    updatedList.splice(index, 1);
    setStakeholderList(updatedList);
  };

  const removeInfrastructure = (index) => {
    const updatedList = [...infrastructureList];
    updatedList.splice(index, 1);
    setInfrastructureList(updatedList);
  };

  return (
    <div className="container">
      <InformationSystem
        onAddStakeholder={addStakeholder}
        onAddInfrastructure={addInfrastructure}
      />
      <div className="stakeholder-box">
        <h2>Stakeholders</h2>
        <div className="stakeholder-container">
          {stakeholderList.map((stakeholder, index) => (
            <Stakeholder
              key={index}
              name={stakeholder}
              onRemove={() => removeStakeholder(index)}
            />
          ))}
        </div>
      </div>
      <div className="infrastructure-box">
        <h2>Infrastructure</h2>
        <div className="infrastructure-container">
          {infrastructureList.map((infrastructure, index) => (
            <Infrastructure
              key={index}
              name={infrastructure}
              onRemove={() => removeInfrastructure(index)}
            />
          ))}
        </div>
      </div>
    </div>
  );
};

export default App;
